import './App.css';
import { TodoWrapper } from './components/TodoWrapper';
import { Navbar } from './components/Navbar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { Home } from './components/Home';
import { About } from './components/About';

function App() {
  return (
    <div className="App">
      <Router>
      <Navbar />
      <TodoWrapper/>
      <Home />
      <About />
      </Router>

    </div>
  );
}

export default App;
